import React from 'react'
import {  Route, Link } from "react-router-dom";
import Home from '../../sections/Home/Home.js';
import Instagram from '../../pages/Instagram/Instagram.js';
import InSync from '../../pages/InSync/InSync.js';
import Design from '../../sections/Design/Design.js';




const Routes = () => (
    <div>
      <Route exact path="/" component={Home} />
      <Route exact path="/dev-instagram" component={Design} />
      <Route exact path="/dev-insync" component={InSync} />
    </div>
);


export default Routes;
